import React, { useState } from 'react';
import { Button, Dialog, DialogTitle, DialogContent, DialogActions, TextField, Typography } from '@mui/material';
import axios from 'axios';

function LoginPage() {
  const [openLogin, setOpenLogin] = useState(false);
  const [openRegister, setOpenRegister] = useState(false);

  // Login state
  const [usernameLogin, setUsernameLogin] = useState('');
  const [passwordLogin, setPasswordLogin] = useState('');

  // Register state
  const [usernameRegister, setUsernameRegister] = useState('');
  const [passwordRegister, setPasswordRegister] = useState('');
  const [firstName, setFirstName] = useState('');
  const [lastName, setLastName] = useState('');
  const [passwordError, setPasswordError] = useState('');

  const handleClickOpenLogin = () => {
    setOpenLogin(true);
  };

  const handleCloseLogin = () => {
    setOpenLogin(false);
  };

  const handleClickOpenRegister = () => {
    setOpenRegister(true);
  };

  const handleCloseRegister = () => {
    setOpenRegister(false);
  };

  // Password validation check
  const validatePassword = (password) => {
    const passwordPattern = /^(?=.*[A-Z])(?=.*\d)[A-Za-z\d]{8,}$/;
    return passwordPattern.test(password);
  };

  const handleRegister = () => {
    if (!validatePassword(passwordRegister)) {
      setPasswordError('Password must be at least 8 characters long, contain an uppercase letter and a number.');
      return;
    }

    // Reset error message if validation passes
    setPasswordError('');

    // Perform registration logic (e.g., send data to backend)
    axios
      .post('http://localhost:5000/register', { username: usernameRegister, password: passwordRegister, firstName, lastName })
      .then((response) => {
        console.log(response.data);
        handleCloseRegister();
      })
      .catch((error) => {
        console.error('Error during registration:', error);
        alert('Error during registration');
      });
  };

  const handleLogin = () => {
    // Perform login logic (e.g., send data to backend)
    axios
      .post('http://localhost:5000/login', { username: usernameLogin, password: passwordLogin })
      .then((response) => {
        console.log(response.data);
        handleCloseLogin();
      })
      .catch((error) => {
        console.error('Error during login:', error);
        alert('Invalid credentials');
      });
  };

  return (
    <div style={{ textAlign: 'center', marginTop: '50px' }}>
      {/* Login Button */}
      <Button variant="contained" onClick={handleClickOpenLogin} style={{ marginRight: '20px' }}>
        Login
      </Button>

      {/* Register Button */}
      <Button variant="contained" onClick={handleClickOpenRegister}>
        Register
      </Button>

      {/* Login Dialog */}
      <Dialog open={openLogin} onClose={handleCloseLogin}>
        <DialogTitle>Login</DialogTitle>
        <DialogContent>
          <TextField
            autoFocus
            margin="dense"
            label="Username"
            fullWidth
            variant="standard"
            value={usernameLogin}
            onChange={(e) => setUsernameLogin(e.target.value)}
          />
          <TextField
            margin="dense"
            label="Password"
            type="password"
            fullWidth
            variant="standard"
            value={passwordLogin}
            onChange={(e) => setPasswordLogin(e.target.value)}
          />
        </DialogContent>
        <DialogActions>
          <Button onClick={handleCloseLogin}>Cancel</Button>
          <Button onClick={handleLogin}>Submit</Button>
        </DialogActions>
      </Dialog>

      {/* Register Dialog */}
      <Dialog open={openRegister} onClose={handleCloseRegister}>
        <DialogTitle>Register</DialogTitle>
        <DialogContent>
          <TextField
            autoFocus
            margin="dense"
            label="Username"
            fullWidth
            variant="standard"
            value={usernameRegister}
            onChange={(e) => setUsernameRegister(e.target.value)}
          />
          <TextField
            margin="dense"
            label="Password"
            type="password"
            fullWidth
            variant="standard"
            value={passwordRegister}
            onChange={(e) => setPasswordRegister(e.target.value)}
          />
          <Typography color="error">{passwordError}</Typography>
          <TextField
            margin="dense"
            label="First Name"
            fullWidth
            variant="standard"
            value={firstName}
            onChange={(e) => setFirstName(e.target.value)}
          />
          <TextField
            margin="dense"
            label="Last Name"
            fullWidth
            variant="standard"
            value={lastName}
            onChange={(e) => setLastName(e.target.value)}
          />
        </DialogContent>
        <DialogActions>
          <Button onClick={handleCloseRegister}>Cancel</Button>
          <Button onClick={handleRegister}>Submit</Button>
        </DialogActions>
      </Dialog>
    </div>
  );
}

export default LoginPage;
